      "title": "Consent Form",
      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n  \u003Cdiv style=\"width: 90%;\"\u003E\n    \n    \u003Ch2\u003E參加同意書\u003C\u002Fh2\u003E\n\n    \u003Ch3\u003E了解文字的處理和其意義\u003C\u002Fh3\u003E\n\n    \u003Cp class=\"text-left\"\u003E你好！我們希望邀請你參加本次關於「閱讀如何發生」以及「如何從單詞中提取語義」的研究。答應參加前，請先細閱本表格。如有問題請隨便提出。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E這項研究由哈里斯堡科技大學認知分析學教授Dr. Erin M. Buchanan主持。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E背景資料:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E今次研究中，你將會被問到一些有關單詞概念的不同問題。例如，定義單詞的特徵，評價單詞的熟悉程度，或單純判斷組文字是否真詞。 \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E實驗程序：\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    你將會通過一台帶有鍵盤的電腦，完成這項線上進行的研究。桌面或手提電腦均可。實驗部份隨機分派，開始前會有指示。實驗完成後，你可以了解更多有關這項研究的背景資料和研究目的。整個實驗應該在三十分鐘內完成。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E參加研究的風險和收益:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    本研究不會收集任何你的識別資料，因此，你的回答應該是匿名的。當前的研究與網上遊戲類似，視乎所需完成的任務，你可能會感到沉悶或疲勞。\n    \u003Cbr \u002F\u003E\n\n    參與這項研究對你並沒有直接的好處。然而，你的回答將有助於我們對語言和認知記憶過程的了解。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E報酬:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E參加本研究，你有可能通過當地的研究人員獲得報酬。\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E保密性和數據共享：\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    我們會採取措施，確保你所提供的資料都會匿名。本研究的數據將被公開發表，供其他研究者使用；但是，沒有數據會表明和你的直接關係。你的名字或其他識別資訊，都不會進入數據庫，在任何口頭或書面報告中也不會提及你與本研究的關係。任何出版物中，都不會出現有關你的可識別資料。\n\n    \u003Cbr \u002F\u003E\n    你的數據在與研究小組以外的人分析之前，任何潛在的識別資料都會被刪除。這些匿名信息可能會被研究小組使用，或與其它研究人員共享，用於今後相關或不相關的研究目的。你的匿名數據也可能會在某些在線數據庫中儲存，例如開放科學框架（這是免費的數據存儲庫，需要註冊才能訪問），這種方式使得其他研究人員和感興趣的人可以訪問數據，以作進一步分析。\n\n    \u003Cbr \u002F\u003E\n   請注意，你的數據將是匿名的，這意味着你一旦完成了研究，就不能要求將其刪除。\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb研究的自願性質:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    參加本研究是基於自願的。\n\n你參加與否的決定，不會影響你目前或將來與哈里斯堡科技大學或當地機構的關係。如果你決定自願參加，你可以自由地回答任何問題，或在任何時候退出研究，而不影響這些關係。\n\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E聯絡方式和問題：\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    本研究由Dr. Erin M. Buchanan主持，與心理科學加速器 (Psychological Science Accelerator) 合作。你現在可以提出任何問題。如果你日後有任何疑問，我們鼓勵你聯絡Dr. Erin M. Buchanan，郵件地址: ebuchanan@harrisburgu.edu。 \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003E問題或顧慮:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n   本研究已經通過哈里斯堡科技大學的機構審查委員會 (IRB) 審查。該委員會確定本研究符合州和聯邦法律以及大學政策要求的人類研究對象保護義務。\n\n    \u003Cp class=\"text-left\"\u003E\u003Ca href=\"https:\u002F\u002Fosf.io\u002F3yk4s\u002Fdownload\"\u003E 如有需要，我們將提供此資訊的副本供你保存。\u003C\u002Fa\u003E\u003C\u002Fp\u003E\n\n    \u003C\u002Fdiv\u003E\n    \n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  請按 \u003Ckbd\u003ESpace\u003C\u002Fkbd\u003E 同意研究並繼續。\n\u003C\u002Ffooter\u003E"
